import React from "react";
import { Outlet, Link } from "react-router-dom";
import { IoHome } from "react-icons/io5";
import './Home.css';

const Home = () => {
    return (
        <>
            <header className="navbar">
                <nav className="navbar-nav">
                    <Link className="nav-item" to="/Home">Home</Link>
                    <Link className="nav-item" to="/Student">Student</Link>
                    <div className="dropdown">
                        <label className="dropbtn">Landlord</label>
                        <div className="dropdown-content">
                            <Link to="/LandlordLogin">Login</Link>
                            <Link to="/LandlordSignup">Signup</Link>
                        </div>
                    </div>
                    <Link className="nav-item" to="/WardenLogin">Warden</Link>
                    <Link className="nav-item" to="/AdminLogin">Admin</Link>
                </nav>
            </header>
            <Outlet />
        </>
    );
}

export default Home;
